import React from "react";
import OrderShedule from "./OrderShedule";

let MainApp = (props) => {

    let aaaa = {
        froms: 'dfdfddf',
        to: 'fdffdfsfdssdfsdf',
        date: '08.20.30',
        price: '123.3'
    }

    return (
        <div>
            <h3>Мои заказы</h3>
            <div>
                {aaaa.map(i => <div style={{display: "flex"}}>
                    <span>{i.froms}</span>
                    <span>{i.to}</span>
                    <span>{i.date}</span>
                    <span>{i.price}</span>
                </div>)}
            </div>
        </div>
    )
}

export default MainApp;
